    function AddImages() {
        let elements = [];
        if(images && images.length != 0)
        {
            for(let i = 0;i < images.length; i++)
            {
                let item = images[i];
                elements.push(<img className={classes.item}></img>)
            }
        }
    }

    return (
        <div className={classes.slider}>

        </div>
    )
}

